import { Component, Input, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ICreateFatca } from '../Interface/createFatca';
import { CustomerService } from '../services/customer.service';
import { formatDate } from '@angular/common';
import { CreateClientComponent } from '../create-client/create-client.component';

@Component({
  selector: 'app-create-fatca',
  templateUrl: './create-fatca.component.html',
  styleUrls: ['./create-fatca.component.css'],
})

export class CreateFatcaComponent implements OnInit {
  @Input() IDFatca! : string;
  newFatca!: FormGroup;
  dataFatca!: ICreateFatca;
  submitted = false;
  //"2017-12-04T08:25:00.000-0600
  fecha = formatDate( new Date(), 'yyyy-MM-ddccccchh:mm:ss.SSSZZ' , 'en-US');
  Obli!: string;
  NumObli!: number;
  Indicators: any[] = [];
  cadenaName!: string;
  cadenaValue!: string;
  tamano: number = 0;
  cont: number = 0;

  constructor(
    private ServiceCustomer: CustomerService,
    private fbFatca: FormBuilder
  ) {
    this.newFatca = this.fbFatca.group({
      idFatca: ['', Validators.required],
      indicatorIdI0: ['', Validators.required],
      nameI: ['', Validators.required],
      valueI: ['', Validators.required],
      indicatorIdI1: ['', Validators.required],
      nameI2: ['', Validators.required],
      valueI2: ['', Validators.required],
      indicatorIdI2: ['', Validators.required],
      nameI3: ['', Validators.required],
      valueI3: ['', Validators.required],
      indicatorIdI3: ['', Validators.required],
      nameI4: ['', Validators.required],
      valueI4: ['', Validators.required],
      countryCode1: ['', Validators.required],
      idObligation1: ['', Validators.required],
      countryCode2: ['', Validators.required],
      idObligation2: ['', Validators.required],
      countryCode3: ['', Validators.required],
      idObligation3: ['', Validators.required],
      countryCode4: ['', Validators.required],
      idObligation4: ['', Validators.required],
      oblifis: ['', Validators.required],
      cantobl: ['', Validators.required],
      descriptionCRS: ['', Validators.required],
      dateValueC: ['', Validators.required],
      dateValueM: ['', Validators.required],
      estadoFatca: ['', Validators.required],
    });
  }

  async ngOnInit() {
    this.getFatcaNew();
  }

  closeFatca() {
    this.ServiceCustomer.$modalFatca.emit(false);
  }

  createFatca() {
    const SubmittedFatca: ICreateFatca = {
      idFatca: this.newFatca.value.idFatca,
      indicators: [
        {
          indicatorId: this.newFatca.value.indicatorIdI0,
          name: this.newFatca.value.nameI,
          value: this.newFatca.value.valueI,
        },
        {
          indicatorId: this.newFatca.value.indicatorIdI1,
          name: this.newFatca.value.nameI2,
          value: this.newFatca.value.valueI2,
        },
        {
          indicatorId: this.newFatca.value.indicatorIdI2,
          name: this.newFatca.value.nameI3,
          value: this.newFatca.value.valueI3,
        },
        {
          indicatorId: this.newFatca.value.indicatorIdI3,
          name: this.newFatca.value.nameI4,
          value: this.newFatca.value.valueI4,
        },
      ],
      obligation: [
        {
          countryCode: this.newFatca.value.countryCode1,
          idObligation: this.newFatca.value.idObligation1,
        },
        {
          countryCode: this.newFatca.value.countryCode2,
          idObligation: this.newFatca.value.idObligation2,
        },
        {
          countryCode: this.newFatca.value.countryCode3,
          idObligation: this.newFatca.value.idObligation3,
        },
        {
          countryCode: this.newFatca.value.countryCode4,
          idObligation: this.newFatca.value.idObligation4,
        },
      ],
      oblifis: this.newFatca.value.oblifis,
      cantobl: this.newFatca.value.cantobl,
      descriptionCRS: this.newFatca.value.descriptionCRS,
      dateFatca: [
        {
          dateId: 'Fecha de creacion',
          dateName: 'Fecha de creacion',
          dateValue: this.newFatca.value.dateValueC,
        },
        {
          dateId: 'Fecha de modificacion',
          dateName: 'Fecha de modificacion',
          dateValue: this.newFatca.value.dateValueM,
        },
      ],
      estadoFatca: this.newFatca.value.estadoFatca,
    };
    this.submitted = true;

    this.ServiceCustomer.createFatca(SubmittedFatca).subscribe((data) =>      
    console.log(data)
    );
  }

  getFatcaNew() {
    console.log('ask someone if getFatca work');
    console.log(this.IDFatca);
    this.ServiceCustomer.getNewFatca().subscribe(async (dataFatca) => {
      console.log(dataFatca['indicators']);
      this.tamano = dataFatca['indicators'].length;
      while(this.cont <= this.tamano-1){ 
       console.log(this.cont);
       this.newFatca.addControl(`indicatorIdI${this.cont}`, this.fbFatca.control('',Validators.required));
       this.cont++; 
       }

       /* this.campos(dataFatca['oblifis']) */
 
      await this.newFatca.setValue({
        idFatca: dataFatca['idFatca'],
        indicatorIdI0: dataFatca['indicators'][0]['indicatorId'],
        nameI: dataFatca['indicators'][0]['name'],
        valueI: dataFatca['indicators'][0]['value'],
        indicatorIdI1: dataFatca['indicators'][1]['indicatorId'],
        nameI2: dataFatca['indicators'][1]['name'],
        valueI2: dataFatca['indicators'][1]['value'],
        indicatorIdI2: dataFatca['indicators'][2]['indicatorId'],
        nameI3: dataFatca['indicators'][2]['name'],
        valueI3: dataFatca['indicators'][2]['value'],
        indicatorIdI3: dataFatca['indicators'][3]['indicatorId'],
        nameI4: dataFatca['indicators'][3]['name'],
        valueI4: dataFatca['indicators'][3]['value'],
        countryCode1: dataFatca['obligation'][0]['countryCode'],
        idObligation1: dataFatca['obligation'][0]['idObligation'],
        countryCode2: dataFatca['obligation'][1]['countryCode'],
        idObligation2: dataFatca['obligation'][1]['idObligation'],
        countryCode3: dataFatca['obligation'][2]['countryCode'],
        idObligation3: dataFatca['obligation'][2]['idObligation'],
        countryCode4: dataFatca['obligation'][3]['countryCode'],
        idObligation4: dataFatca['obligation'][3]['idObligation'],
        oblifis: dataFatca['oblifis'],
        cantobl: dataFatca['cantobl'],
        descriptionCRS: dataFatca['descriptionCRS'],
        dateValueC: dataFatca['dateFatca'][0]['dateValue'],
        dateValueM: dataFatca['dateFatca'][1]['dateValue'],
        estadoFatca: dataFatca['estadoFatca'],
      });
    });
  }

  campos(varOblifis: string) {
    console.log(varOblifis);
    this.Obli = varOblifis;
    if (this.Obli == 'S') {
      let control = this.newFatca.get('cantobl');
      /* this.newFatca.controls['cantobl'].valueChanges.subscribe(value => {}) */

      control?.setValidators([Validators.required, Validators.minLength(1)]);
      /* this.newFatca.addValidators(this.cantobl:Validators.required) */
    }

    /* let numcampo : */
  }

  userNamengmodelchange(varCantobl: number) {
    this.NumObli = varCantobl;
    console.log(varCantobl);
  }
}
<div id="global" class="modal">
    <div class="container-padding-modal">
        <body>
            <form action="#" [formGroup]="newFatca" (ngSubmit)="createFatca()">
                <div class="button-close">
                    <input type="image" (click)="closeFatca()" src="https://cdn-icons-png.flaticon.com/512/458/458595.png">
                    <div class="spacer"></div>
                </div>
                <div class="user-details">
                    <div class="subtitle">
                        <h2>CREACIÓN FATCA</h2>
                    </div>
                    <div class="input-box">
                        <span class="details">Id Fatca: </span>
                        <input type="text" maxlength="16" formControlName="idFatca">
                        <div class="error" *ngIf="submitted && this.newFatca.get('documentTypeDT')?.errors?.['required']">Campo Obligatorio</div>
                    </div>
                    <div class="gender-details">
                        <span class="gender-title">Obligaciones Fiscales: </span>
                        <!-- <fieldset> -->
                            <div class="category">
                                <label for="Id_oblifisS">Si</label>
                                <input id="Id_oblifisS" (click)="campos(oblifisS.value)" type="radio" maxlength="1" value="S" #oblifisS formControlName="oblifis">
                                <label for="Id_oblifisN">No</label>
                                <input id="Id_oblifisN" (click)="campos(oblifisN.value)" type="radio" maxlength="1" value="N" #oblifisN formControlName="oblifis">
                            </div>
                        <!-- </fieldset> -->        
                        <div class="error" *ngIf="submitted && this.newFatca.get('oblifis')?.errors?.['required']">Campo Obligatorio</div>
                    </div>  
                    <div class="input-box" *ngIf="Obli == 'S'">
                        <span class="details">Cantidad Obligaciones: </span>
                        <input type="text" maxlength="20" #cantobli formControlName="cantobl" (ngModelChange)="userNamengmodelchange($event)">
                        <div class="error" *ngIf="submitted && this.newFatca.get('cantobl')?.errors?.['required']">Campo Obligatorio</div>
                    </div>
                    <div class="input-box">
                        <span class="details">Descripción CRS: </span>
                        <input type="text" maxlength="20" formControlName="descriptionCRS">
                        <div class="error" *ngIf="submitted && this.newFatca.get('descriptionCRS')?.errors?.['required']">Campo Obligatorio</div>
                    </div>
                    <div class="input-box">
                        <span class="details">Estado: </span>
                        <input type="text" maxlength="20" formControlName="estadoFatca">
                        <div class="error" *ngIf="submitted && this.newFatca.get('estadoFatca')?.errors?.['required']">Campo Obligatorio</div>
                    </div>
                    <div class="subtitle">
                        <h3>Indicadores</h3>
                    </div>  
                    <div class="economic-details">
                        <div class="input-box">
                            <span>Id Indicador</span>
                           <!--  <input *ngFor="let tam of Indicators;let i = index" type="text" maxlength="21" formControlName = "indicatorIdI{{i+1}}"> -->
                           <input type="text" maxlength="21" formControlName="indicatorIdI0">
                            <div class="error" *ngIf="submitted && this.newFatca.get('indicatorIdI0')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="indicatorIdI1">
                            <div class="error" *ngIf="submitted && this.newFatca.get('indicatorIdI1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="indicatorIdI2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('indicatorIdI2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="indicatorIdI3">
                            <div class="error" *ngIf="submitted && this.newFatca.get('indicatorIdI3')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Nombre</span>
                            <input type="text" maxlength="3" formControlName="nameI">
                            <div class="error" *ngIf="submitted && this.newFatca.get('nameI')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="3" formControlName="nameI2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('nameI2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="3" formControlName="nameI3">
                            <div class="error" *ngIf="submitted && this.newFatca.get('nameI3')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="3" formControlName="nameI4">
                            <div class="error" *ngIf="submitted && this.newFatca.get('nameI4')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Valor</span>
                            <input type="text" maxlength="1" formControlName="valueI">
                            <div class="error" *ngIf="submitted && this.newFatca.get('valueI')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="1" formControlName="valueI2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('valueI2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="1" formControlName="valueI3">
                            <div class="error" *ngIf="submitted && this.newFatca.get('valueI3')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="1" formControlName="valueI4">
                            <div class="error" *ngIf="submitted && this.newFatca.get('valueI4')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                    </div> 
                    <div class="subtitle" *ngIf="Obli == 'S'">
                        <h3>Obligaciones</h3>
                    </div>  
                    <div class="economic-details" *ngIf="Obli == 'S' && NumObli == 1">
                        <div class="input-box">
                            <span>Código Obligación</span>
                            <input type="text" maxlength="21" formControlName="countryCode1">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode1')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Id Obligación</span>
                            <input type="text" maxlength="21" formControlName="idObligation1" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation1')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                    </div>  
                    <div class="economic-details" *ngIf="Obli == 'S' && NumObli == 2">
                        <div class="input-box">
                            <span>Código Obligación</span>
                            <input type="text" maxlength="21" formControlName="countryCode1">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode2')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Id Obligación</span>
                            <input type="text" maxlength="21" formControlName="idObligation1" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation2" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation2')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                    </div>  
                    <div class="economic-details" *ngIf="Obli == 'S' && NumObli == 3">
                        <div class="input-box">
                            <span>Código Obligación</span>
                            <input type="text" maxlength="21" formControlName="countryCode1">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode3">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode3')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Id Obligación</span>
                            <input type="text" maxlength="21" formControlName="idObligation1" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation2" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation3" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation3')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                    </div>
                    <div class="economic-details" *ngIf="Obli == 'S' && NumObli == 4">
                        <div class="input-box">
                            <span>Código Obligación</span>
                            <input type="text" maxlength="21" formControlName="countryCode1">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode2">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode3">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode3')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="countryCode4">
                            <div class="error" *ngIf="submitted && this.newFatca.get('countryCode4')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                        <div class="input-box">
                            <span>Id Obligación</span>
                            <input type="text" maxlength="21" formControlName="idObligation1" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation1')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation2" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation2')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation3" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation3')?.errors?.['required']">Campo Obligatorio</div>
                            <input type="text" maxlength="21" formControlName="idObligation4" >
                            <div class="error" *ngIf="submitted && this.newFatca.get('idObligation4')?.errors?.['required']">Campo Obligatorio</div>
                        </div>
                    </div>
                    <div class="data-date">
                        <div class="input-box">
                            <span class="details">Fecha Creación: </span>
                            <p class="spanData">{{fecha}}</p>
                            <!-- <input type="date" formControlName="dateValueC"> -->
                        </div>
                        <div class="input-box">
                            <span class="details">Fecha Modificación: </span>
                            <p class="spanData">{{fecha}}</p>
                            <!-- <input type="text" formControlName="dateValueM"> -->
                        </div>
                    </div>
                </div>
                <div class="button">
                    <input type="submit" value="Guardar">
                </div>
            </form>
        </body>
    </div>
</div>
